<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>

        body{
            overflow: hidden;
            background-color: lightblue;
        }
        
        /* Input page: */

        #input {
            font-family: Arial, sans-serif;
            background-color: #f9f9f9;
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 5px;
        }

        .input-box {
            flex: 1;
            width: 80%;
            background: white;
            padding: 1px 10px;
            border-radius: 10px;
            box-shadow: 0 2px 8px rgba(0,0,0,0.1);
        }

        .input-button{
            font-size: 8px;
        }

        .label {
            font-weight: bold;
            display: block;
            margin-bottom: 8px;
            font-size: 8px;
        }

        input[type="file"] {
            display: block;
            margin-bottom: 10px;
        }

        #submit-job-container {
            text-align: center;
        }

        #submit-job {
            background-color: #4CAF50;
            color: white;
            padding: 10px 25px;
            font-size: 8px;
            border: none;
            border-radius: 8px;
            cursor: pointer;
            transition: background-color 0.2s ease;
        }

        #submit-job:hover {
            background-color: #45a049;
        }

        #input-title{
            padding: 0vh;
        }

        /* Results page: */

        .container {
            display: flex;
            justify-content: space-between;
            flex-wrap: wrap;
            background-color: white;
            border-style: solid;
            border-color: black;
            border-radius: 10px;
            flex-direction: column;
        }

        .slider{
            writing-mode: vertical-lr; /* Or vertical-rl for reverse direction */
            direction: rtl; /* For consistent sliding direction (up for higher values) */
            height: 30%;
            width: 5vh;
            accent-color: black;
            margin: 2px;
            margin-left: 8px;
            margin-top: 20px;
        }

        .header{
            font-size: 20x;  
            text-decoration: underline;
            display: flex; 
            justify-content: center; 
            padding-top: 2px;
        }

        .edit-button{   
            width: 12vh;
            height: 8vh;
            padding: 0px;
            margin: 2px;
            margin-top: 5px;
            position: relative;
            justify-content: center; /* Centers horizontally */
            align-items: center;   /* Centers vertically */
        }

        #swap-button{
            font-size: 15px;
        }

        #plot-button{
            font-size: 3px;
        }

        #deselect-tree-button{
            font-size: 4px;
        }

        #deselect-point-button{
            font-size: 4px;
        }

        #svg-container{
            width: 100%;
            height: 95%;
        }

        #node-editing-container{
            width: 15%;
            position: relative;
        }

        #file-input-container{
            float: left;
            margin-top: 1vh;
            height: 12vh;
            width: 110vh;
        }

        #distance-container{
            width: 35%;
            height: 40%;
            float: right;
            margin-top: 5vh;
        }

        #correlation-container{
            width: 35%;
            height: 23vh;
            float: right;
            margin-top: 3vh;
        }

        #tree-container{
            width: 63%;
            height: 91vh;
            overflow: scroll;
            justify-content: space-between;
            margin-top: 5vh;
            float: left;
        }

        
    </style>
</head>
<body>
    <div id="input" style="display: none;">
        <b id="input-title">Input files: fa, msa, phb</b>
        <div id="left-family-input" class="input-box">
            <label class="label" for="left-family">Left Family:</label>
            <input type="file"  class="input-button" id="left-family" name="left-family">
        </div>

        <div id="right-family-input" class="input-box">
            <label class="label" for="right-family">Right Family:</label>
            <input type="file" class="input-button" id="right-family" name="right-family">
        </div>
        <div>
            <button id="submit-job">Submit Job</button>
        </div>
    </div>
    <div id="results">
        <div class="container" id="tree-container"> 
            <b class="header">Tree Plots</b>
            <div id="svg-container">
                <div id="node-editing-container" style="height: 100%;">
                    <input type="range" min="1" max="5" value="1" step="1" class="slider" id="scaler">
                    <button class="edit-button" id="swap-button" style="display: none;">Swap Subtree</button>
                    <button class="edit-button" id="plot-button" style="display: none;">Plot Subtree Distances</button>
                    <button class="edit-button" id="deselect-tree-button" style="display: none;">Deselect Subtree</button>
                </div>
            </div>
        </div>
        <div class="container" id="distance-container" style="display: block;">
            <b class="header">Interspecies Distances</b>
            <button class="edit-button" id="deselect-point-button" style="display: none; height: 15%; margin-top: -10px;">Deselect Point</button>
        </div>
        <div class="container" id="correlation-container" style="display: block;">
            <b class="header">Distance Correlation</b>
        </div>
    </div>

<script id="draw-distances-script">

const distanceContainer = document.getElementById("distance-container")
let deselectButton = document.getElementById("deselect-point-button")

let trees;
let graphBuffer = 0.05
let pointsSelected = new Set() // Shows all points selected in the current subgroup, can be grouped from tree or distance plot selection. Used to calculate correlation
let currentPointsSelected = []; // Holds current point selected from the plot, purple, for deselecting and tree highlighting purposes
let currentTreePoints = []; //Holds points selected from the tree specifically, for specific coloring and deselecting purposes

function getSpecies(id){
    return id.split("-")
}

function removeDataPoints(points){
    Array.from(points).forEach(point => {
        pointsSelected.delete(point)
        const index = currentPointsSelected.indexOf(point)
        if(index != -1){
            currentPointsSelected.slice(index, 1)
        }
    })

    updateCorrelation(pointsSelected)
}

// When datapoints are newly selected on the plot, we update the correlation to reflect these selected points. Selected points are marked as red.
function addDataPoints(points){ // Takes in set of svg circles
    // Dealing with the pointsSelected list, which is updates properly as it goes. When it is added to, we recalculate the correlation and replot it for the user
    // We need to calculate the left and right averages of distances, and then add corresponding ones on each side? So first get averages then 
    Array.from(points).forEach(point => {
        pointsSelected.add(point)
    })
    updateCorrelation(pointsSelected)
}

function colorPoints(points, color){
    Array.from(points).forEach(point => {
        if(color == "red"){ //Red is the special case because we are distinguishing purple vs green selected in the datapoints, while green, purple, and deselecting "black" override eachother always
            if(currentTreePoints.includes(point)){
                point.style.fill = "green"
            }
            else if(currentPointsSelected.includes(point)){
                point.style.fill = "purple"
            }
            else{
                point.style.fill = color
            }
        }
        else{
            point.style.fill = color
        }
    })
}

function getPairs(species){
    let pairs = []
    species.sort()
    for (let i = 0; i < species.length; i++) {
        for (let j = i + 1; j < species.length; j++) {
            if(species[i] != species[j]){
                pairs.push(species[i]+"-"+species[j])
            }
        }
    }
    return pairs
}

// When data points are selected on the trees or in the plot itself, they are added to the dataset and the correlation equation is updated 
function addTreeDataPoints(connectors){
    if(connectors.length > 1){ // We have a new dataset
        const species = Array.from(connectors).map(connector => connector.id)
        let pairsAdded = getPairs(species);
        const points = Array.from(pairsAdded).map(pair => {
            return document.getElementById(pair)
        })

        console.log("Points",points)

        //Coloring logic:
        const temp = currentTreePoints
        currentTreePoints = points
        colorPoints(temp, "red")
        colorPoints(points, "green")

        // Add to dataset
        addDataPoints(points)
    }
    else{ // We have no dataset, but we undo the last treeselected points
        const temp = currentTreePoints
        currentTreePoints = []
        colorPoints(temp, "red")
    }
}

function removeTreeDataPoints(connectors){
    const temp = currentTreePoints
    currentTreePoints = []
    colorPoints(temp, "black")
    if(connectors.length > 1){ //If we have a real grouping then we take extra steps to remove the dataset and update correlation
        const species = Array.from(connectors).map(connector => connector.id)
        let pairsAdded = getPairs(species);
        const points = Array.from(pairsAdded).map(pair => {
            return document.getElementById(pair)
        })
        removeDataPoints(points)
    }
}

function selectDataPoints(x,y, width, height){ //Given x, y, width, and height of selection rect

    })
    colorPoints(newPoints, "purple")
    addDataPoints(newPoints)

    colorDataPointsInTree(currentPointsSelected, "red")

function dataPointClicked(point){
    // Change last one selected to red, no longer one selected
    currentPointsSelected.forEach(currPoint => {
        currPoint.style.fill = "red"
        colorDataPointsInTree([currPoint], "red")
    })
    //Update point selected
    currentPointsSelected = [point]

    // Get species in this pair selected. No need to add these to the list of species of intersest, because we are only adding this correspondence not the species within
    colorDataPointsInTree([point], "purple")

    // Add to list of selected subdata for correlation and tracking etc. Can come from tree or selection here
    // deselectButton.style.display = "block"
    addDataPoints([point])
}

function getDataDist(pairs, leftJson, rightJson){
    const dataPoints = {}
    Array.from(pairs).forEach(pair => {
        const species1 = pair[0]
        const species2 = pair[1]
        const inner = {}

        // Left json:
        let distL;
        if(Object.keys(leftJson).includes(species1)){
            if(Object.keys(leftJson[species1]).includes(species2)){
                distL = leftJson[species1][species2]
            }
        }
        if(Object.keys(leftJson).includes(species2)){
            if(Object.keys(leftJson[species2]).includes(species1)){
                distL = leftJson[species2][species1]
            }
        }
        inner['left'] = distL

        // Right json:
        let distR;
        if(Object.keys(rightJson).includes(species1)){
            if(Object.keys(rightJson[species1]).includes(species2)){
                distR = rightJson[species1][species2]
            }
        }
        if(Object.keys(rightJson).includes(species2)){
            if(Object.keys(rightJson[species2]).includes(species1)){
                distR = rightJson[species2][species1]
            }
        }
        inner['right'] = distR

        dataPoints[species1+"-"+species2] = inner
    })
    return dataPoints
}

function getCommonPairs(leftJson, rightJson){
    const commonSpecies = []
    Array.from(leftJson['all']).forEach(species => {
        if(Array.from(rightJson['all']).includes(species)){
            commonSpecies.push(species)
        }
    })
    console.log(commonSpecies, "hello")
    const commonPairs = []
    for (let i = 0; i < commonSpecies.length; i++) {
        for (let j = i + 1; j < commonSpecies.length; j++) {
            const species1 = commonSpecies[i]; const species2 = commonSpecies[j]
            if(species1 != species2){
                commonPairs.push([species1, species2])
            }
        }
    }
    return commonPairs
}

function drawPoint(point, id){
    const dot = document.createElementNS("http://www.w3.org/2000/svg", "circle")
    dot.setAttribute("class", "datapoint")
    dot.setAttribute("id", id)
    dot.setAttribute("cx", point["left"])
    dot.setAttribute("cy", point["right"])
    dot.setAttribute("r", .01)
    dot.style.fill = "black"
    let currColor = "black"
    dot.addEventListener("mouseenter", () => {
        currColor = dot.style.fill
        dot.style.fill = "purple"
    })
    dot.addEventListener("mouseleave", () => {
        const isSelected = currentPointsSelected.includes(dot)
        if(!isSelected){
            dot.style.fill = currColor
        }
        if(isSelected){
            dot.style.fill = "purple"
        }
    })
    dot.addEventListener("click", () => {
        currColor = currColor
        dataPointClicked(dot)
    })
    return dot
}

function drawDistance(leftDistance, rightDistance, treeSvg){
    trees = treeSvg //Set global variable to link this to the tree for manipulation later 
    
    // let files = [file1, file2]
    // const jsons = await Promise.all(
    //     files.map(file =>
    //         fetch(file)
    //             .then(res => res.json())
    //     )
    // );

    const jsons = [leftDistance, rightDistance]

    const pairs = getCommonPairs(jsons[0], jsons[1]) //List of tuples for all common species pairs, now we just need their data and we can then generate points

    const data = getDataDist(pairs, jsons[0], jsons[1])

    const svg = document.createElementNS("http://www.w3.org/2000/svg", "svg");
    svg.setAttribute("id", "distance-svg")
    svg.setAttribute("width", "100%")
    svg.setAttribute("height", "75%")

    const dataSet = new Set();
    const dataGroup = document.createElementNS("http://www.w3.org/2000/svg", "g");
    dataGroup.setAttribute("id", "distance-data")

    let maxx = 0;
    let maxy = 0;
    for(const point in data){
        const datapoint = data[point]
        const newDot = drawPoint(datapoint, point)
        if(datapoint['left'] > maxx){
            maxx = datapoint['left']
        }
        if(datapoint['right'] > maxy){
            maxy = datapoint['right']
        }
        dataSet.add(newDot)
        dataGroup.appendChild(newDot)
    }

    maxx = Math.ceil(maxx*10)/10; maxy = Math.ceil(maxy*10)/10

    // Set specific attributes to the graph:
    svg.setAttribute("viewBox", `${-graphBuffer} ${-graphBuffer} ${maxx+ (graphBuffer*2)} ${maxy+ (graphBuffer*2)}`);
    const axis = createAxis(maxx, maxy)

    svg.appendChild(axis)
    svg.appendChild(dataGroup)

    // Now before adding we will transform and scale the graph
    svg.setAttribute("transform", "rotate(270) scale(0.8)")

    distanceContainer.appendChild(svg)

    // Set correlation calculating and display into motion, call next file:
    drawCorrelation(dataSet)

    const selectionRect = document.createElementNS("http://www.w3.org/2000/svg", "rect")
    selectionRect.setAttribute("id", "selection-rect")
    selectionRect.style.fill = "rgba(0, 0, 0, 0)";
    selectionRect.style.stroke = "black"
    selectionRect.style.strokeWidth = 0.005
    let rectMade = false
    var pt = svg.createSVGPoint();
    let startPoint = null;

    function cursorPoint(evt){
        pt.x = evt.clientX; pt.y = evt.clientY;
        return pt.matrixTransform(svg.getScreenCTM().inverse());
    }

    svg.addEventListener('mousedown', (e) => {
        // When mouse down create box if we get a mouse move
        rectMade = true
        startPoint = cursorPoint(e)
        selectionRect.setAttribute("x", startPoint.x);
        selectionRect.setAttribute("y", startPoint.y);
        selectionRect.setAttribute("width", 0);
        selectionRect.setAttribute("height", 0);
        selectionRect.style.display = "block";
    })

    svg.addEventListener('mousemove', (e) => {
        if (!rectMade) return;

        const loc = cursorPoint(e);

        const x = Math.min(loc.x, startPoint.x);
        const y = Math.min(loc.y, startPoint.y);
        const width = Math.abs(loc.x - startPoint.x);
        const height = Math.abs(loc.y - startPoint.y);

        selectionRect.setAttribute("x", x);
        selectionRect.setAttribute("y", y);
        selectionRect.setAttribute("width", width);
        selectionRect.setAttribute("height", height);
    })

    // Reset selection rectangle is mouse goes up
    svg.addEventListener("mouseup", (e) => {
        rectMade = false
        selectDataPoints(parseFloat(selectionRect.getAttribute("x")), parseFloat(selectionRect.getAttribute("y")), parseFloat(selectionRect.getAttribute("width")), parseFloat(selectionRect.getAttribute("height")))
        selectionRect.style.display = "none"
    })

    svg.appendChild(selectionRect)

    console.log(svg)
}

function createLabels(max, axis, nonaxis){
    let increments = []
    let curr = 0.1;
    while(curr <= max){
        increments.push(curr)
        curr = (curr * 10 + 1)/10
    }

    return increments.map(increment => {
        let label = document.createElementNS("http://www.w3.org/2000/svg", "text")
        label.setAttribute(axis, increment)
        label.setAttribute(nonaxis, -.05)
        label.style.fontSize = "0.03px"
        label.textContent = increment
        label.style.userSelect = "none"
        if(axis == "x"){
            label.setAttribute("transform", `rotate(90, ${increment}, ${-0.05})`)
        }
        else{
            label.setAttribute("transform", `rotate(90, ${-0.05}, ${increment})`)
        }

        return label
    })
}

function createAxis(maxx, maxy){
    const axis = document.createElementNS("http://www.w3.org/2000/svg", "g");
    axis.setAttribute("id", "axis")
    const x = document.createElementNS("http://www.w3.org/2000/svg", "line");
    const y = document.createElementNS("http://www.w3.org/2000/svg", "line"); 

    graphBuffer = 0.05

    x.setAttribute("x1", 0);
    x.setAttribute("y1", 0); 
    x.setAttribute('x2', maxx+graphBuffer);
    x.setAttribute("y2", 0);

    y.setAttribute("x1", 0);
    y.setAttribute("y1", 0); 
    y.setAttribute('x2', 0);
    y.setAttribute("y2", maxy+graphBuffer);

    let labels = createLabels(maxx, "x", "y")
    labels = labels.concat(createLabels(maxy, "y", "x"))
    labels.forEach(label => {
        axis.appendChild(label)
    })

    x.style.stroke = 'black'; y.style.stroke = 'black'
    x.style.strokeWidth = 0.01; y.style.strokeWidth = 0.01

    axis.appendChild(x); axis.appendChild(y);

    return axis
}

deselectButton.addEventListener("click", () => deselectCurrentPoints())
</script>
<script id="draw-correlation-script">
// Group S is left, group R is right
const correlationContainer = document.getElementById("correlation-container")
let subSetCorrelation;
let subSetCorrelationLabel;
let subsetOrganismCount;

function getSpecies(id){
    return id.split('-')
}

function calculateCorrelation(S, R, SAvg, RAvg){ // Size of S and R must be the same cause they show number of points
    const len = R.length
    if(len != S.length){
        throw Error("Problem with lengths of subgroups")
    }
    let numerator = 0;
    for(let i = 0; i<S.length; i++){
        numerator += (R[i]-RAvg)*(S[i]-SAvg)
    }
    let RSum = 0;
    for(let i = 0; i<S.length; i++){
        RSum += Math.pow(R[i]-RAvg, 2)
    }
    let SSum = 0;
    for(let i = 0; i<S.length; i++){
        SSum += Math.pow(S[i]-SAvg, 2)
    }
    let denominator = Math.sqrt(RSum)*Math.sqrt(SSum)

    const correlation = numerator / denominator
    return correlation
}

function getAvg(dataSet){
    const sum = Array.from(dataSet).reduce((avg, curr) => {return curr+avg}, 0)
    const avg = sum / dataSet.length
    return avg
}

function getData(dataSet){ //Given datapoints from svg, gets left and right points to calculate correlation 
    const S = Array.from(dataSet).map(point => parseFloat(point.getAttribute("cx")))
    const R = Array.from(dataSet).map(point => parseFloat(point.getAttribute("cy")))
    return [S,R]
}

function getCorrelation(dataSet){ //All dataset, of points, so need to get proper stuff, in last files format
    const [S,R] = getData(dataSet)
    const correlation = calculateCorrelation(S,R, getAvg(S), getAvg(R))
    return parseFloat(correlation.toFixed(3))
}

function updateCorrelation(dataSet){ // Get latest subset
    if(dataSet.size > 1){
        let correlation = getCorrelation(dataSet)
        if(correlation < 0){
            correlation = 0
        }
        subSetCorrelation.setAttribute("points", `${correlation-0.03},0.6 ${correlation},0.4 ${correlation+0.03},0.6`)

    }
    else{
        subSetCorrelation.removeAttribute("points")
        subSetCorrelationLabel.removeAttribute("x")
        subSetCorrelationLabel.textContent = ""
        return
    }
    //Change html to new subset correlation and plot it. Total won't ever change, hence the point of this function
    return
}

function setviewbox()
{

  vs.x = viewboxSize.x * viewboxScale;
  vs.y = viewboxSize.y * viewboxScale;

  viewboxPosition.x = Math.max(GRAPH_BOUNDS.xMin, Math.min(GRAPH_BOUNDS.xMax - vs.x, viewboxPosition.x));

  vp.x = viewboxPosition.x;
  vp.y = viewboxPosition.y;
  
  const svg = document.getElementById("tree-svg");
  if(svg){
    svg.setAttribute("viewBox", vp.x + " " + vp.y + " " + vs.x + " " + vs.y);
  }
}

function wheel(e){
    const sign = e.deltaY
    const maxScale = 5
    const minScale = 1
    const sensitivity = 0.2

    if(sign > 0){
        if(viewboxScale > minScale){
            viewboxScale -= sensitivity
        }
    }
    else{
        if(viewboxScale < maxScale){
            viewboxScale += sensitivity
        }
    }
    setviewbox();
}

function mousemove(e)
{

  mousePosition.x = e.offsetX;
  mousePosition.y = e.offsetY;
  
  if (mouseDown)
  {

    viewboxPosition.x = viewboxStartPosition.x + (mouseStartPosition.x - e.pageX) * viewboxScale;
    viewboxPosition.y = viewboxStartPosition.y + (mouseStartPosition.y - e.pageY) * viewboxScale;
    setviewbox();
  }

}

function mouseup(e) {
  window.removeEventListener("mouseup", mouseup);
  
  mouseDown = false;
  setviewbox()
}

function createLinesDOMElements(parentx, parenty, childx, childy){

    line1.setAttribute("x1", parentx);
    if(parenty > childy){ // If we are going up, put gap between start of line

    else{ // If we are going down, put gap between start of line

    line1.setAttribute("x2", parentx);
    line1.setAttribute("y2", childy);

        function buildDOMTree(parentEntry, parentGroup){
            if(!parentEntry.hasOwnProperty("children")){ // We have a leaf, base case
                // Child nodes have already been made, nothing to be done, end recursion path
                return
            }
            else{ // We have an inner node
                const children = parentEntry["children"]
                children.forEach((child) => {
                    const childEntry = JSON[child] // Parent is a DOM element which we will append to, we will use to get id
                    let id= child, x = childEntry["x"], y = childEntry["y"]
                    let childGroup = document.createElementNS("http://www.w3.org/2000/svg", "g");

                    //Create lines from node
                    let lines = createLinesDOMElements(parentEntry["x"], parentEntry["y"], x, y)
                    lines.forEach((line) => {
                        childGroup.appendChild(line)
                    })

                    //Create node
                    //let childElem;
                    if(!childEntry.hasOwnProperty("children")){
                        //childElem = createNodeDOMElement(id, x, y, "leaf", childEntry["name"])
                        let [labelElem, orgLine] = createLabelDOMELement(x, y, childEntry["name"], side)
                        childGroup.appendChild(labelElem)
                        if(orgLine){
                            connectorsGroup.appendChild(orgLine)
                        }
                    }
                    else{
                        const childElem = createNodeDOMElement(id, x, y)
                        childGroup.appendChild(childElem);
                    }

                    childGroup.setAttribute("id", id+"-group")
                    parentGroup.appendChild(childGroup); // Extend tree to next level, previous level now has groups as a child along with the lines and nodes, this will hold the next level of 

                    buildDOMTree(childEntry, childGroup)
                })
            }
        }

    })

    // Now that we have both trees created via a DOM tree with roots as the base, we can assemble the svg with both roots holding the trees below
    GRAPH_BOUNDS.xMin = 0
    GRAPH_BOUNDS.yMin = 0
    GRAPH_BOUNDS.xMax = width + scaler/50
    GRAPH_BOUNDS.yMax = height + scaler/50
    viewboxSize = {x: GRAPH_BOUNDS.xMax / 5, y: GRAPH_BOUNDS.yMax / 5};
    svg.setAttribute("viewBox", `${GRAPH_BOUNDS.xMin} ${GRAPH_BOUNDS.yMin} ${GRAPH_BOUNDS.xMax} ${GRAPH_BOUNDS.yMax}`);
    svg.setAttribute("width", "100%")
    svg.setAttribute("height", "100%")//{height*scaler + scaler/20})
    svgContainer.appendChild(svg) 

    roots.forEach((root) => {
         svg.appendChild(root)
    })

    svg.appendChild(connectorsGroup)

    svgContainer.style.display = "flex"; // Set svg to viewable

    svg.addEventListener("wheel",wheel)
    svg.addEventListener("mousemove", mousemove);
    svg.addEventListener("mousedown", mousedown);

    drawDistance(leftDistance, rightDistance, svg)
}

</script>
